"377985":{"id":"377985","name":"Fan","slug":"fan","original_title":"Fan","overview":"Gaurav Chandna é um rapaz de classe média, que é sósia e fã duma estrela de Bollywood, Aryan Khanna. Quando Gaurav ganha um concurso de superstar, num festival local, ele decide ir ao encontro Aryan. Ao chegar a Mumbai, Gaurav testemunha milhares de fãs se reunirem na casa de Aryan, o que torna difícil para chegar até ele. Mais tarde, o ator Sid Kapoor dá uma declaração dura contra Aryan na mídia, o que irrita Gaurav. Ele entra como penetra na filmagem de Sid e amarra-o na van de maquiagem. Gaurav bate nele e obriga-o a pedir desculpas a Aryan diante da câmera. O vídeo mais tarde se torna viral deixando Aryan espantado. Esperando que Aryan elogie sua ação, Gaurav envia uma mensagem para ele assumindo total responsabilidade pelo incidente, mas Aryan diz que foi um crime. De coração partido com comportamento rude de Aryan, Gaurav queima todos os seus cartazes e decide se vingar do que ele considera um insulto e destruir a reputação do seu ídolo.","first_air_date":"2016-04-14","runtime":138,"episode_run_time":[138],"vote_average":6.3,"created_by":["Red Chillies Entertainment","Yash Raj Films","Prime Focus"],"production_companies":[{"name":"Red Chillies Entertainment"},{"name":"Yash Raj Films"},{"name":"Prime Focus"}],"cast":["शाहरुख़ ख़ान","Deepika Amin","Yogendra Tiku","Shriya Pilgaonkar","Sayani Gupta"],"backdrop_path":"https://image.tmdb.org/t/p/original/3H73lwajun0ZcKVcm8m9XJSMIhy.jpg","poster_path":"https://image.tmdb.org/t/p/original/ukMYsujfyWhSeIBAc9hGEFEkrJD.jpg","certification":"N/A","genres":["Ação","Aventura","Thriller"],"trailer":"N/A"},
