"241958":{"id":"241958","name":"O Despertar dos Deuses","slug":"o-despertar-dos-deuses","original_title":"Prisoners of the Sun","overview":"Um jovem aprendiz de arqueólogo entra de cabeça em uma perigosa expedição nas areias ancestrais do Egito. Para conseguir descobrir seus mistérios, ele vai ter que se livrar de armadilhas mortais e monstros de outras eras. Sem avisos, ele descobre um segredo mais antigo do que a história, liberando uma ameaça que ninguém poderia prever. E pior: este pode ser o início do fim do mundo.","first_air_date":"2013-12-20","runtime":88,"episode_run_time":[88],"vote_average":3.9,"created_by":["ME Completion","Cinemakers"],"production_companies":[{"name":"ME Completion"},{"name":"Cinemakers"}],"cast":["John Rhys-Davies","David Charvet","Carmen Chaplin","Emily Holmes","Nick Moran"],"backdrop_path":"https://image.tmdb.org/t/p/original/5E11a3n4ccCnqXWAAbup33FMptk.jpg","poster_path":"https://image.tmdb.org/t/p/original/uxVVyvT52kAxE3x6BFAnb3ZgNt.jpg","certification":"N/A","genres":["Mistério","Ação","Aventura","Terror"],"trailer":"N/A"},
"18443":{"id":"18443","name":"Decoys 2: Sedução Alienígena","slug":"decoys-2-seducao-alienigena","original_title":"Decoys 2: Alien Seduction","overview":"Aquelas criaturas alienígenas lindas e gostosas estão de volta para aterrorizar outro campus universitário! Kim Poirier e Corey Sevier retornam nesta seqüência de Decoys, um suspense arrepiante no qual alienígenas se disfarçam de garotas maravilhosas que seduzem seus colegas de classe na tentativa de salvar sua espécie da extinção. Infelizmente, estas delícias intergalácticas estão tendo bastante dificuldade em reproduzir - seu processo de reprodução faz com que a temperatura de seus corpos caia abaixo de zero, proporcionando aos seus parceiros humanos um caso severo de hipotermia. Um por um, o número de estudantes diminui e depende de Luke (Sevier) espalhar a mensagem antes que seja tarde demais.","first_air_date":"2007-03-06","runtime":94,"episode_run_time":[94],"vote_average":5.4,"created_by":["Decoys Production","Alian Girls Films"],"production_companies":[{"name":"Decoys Production"},{"name":"Alian Girls Films"}],"cast":["Kim Poirier","Corey Sevier","Tobin Bell","Tyler Johnston","Dina Meyer"],"backdrop_path":"https://image.tmdb.org/t/p/original/vr2B7YO2E8EDgkiR3uouPZVCpxQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/29ntxtmUwcA8RPVdEHStsaqrLGq.jpg","certification":"N/A","genres":["Terror","Ficção científica"],"trailer":"N/A"},
"320295":{"id":"320295","name":"Detetive Byomkesh Bakshy!","slug":"detetive-byomkesh-bakshy","original_title":"डिटेक्टिव ब्योमकेश बक्शी!","overview":"Numa interpretação contemporânea de Calcutá, devastada pela guerra em 1942, a história segue a primeira aventura de Byomkesh, recém-saído da faculdade que se opõe a um criminoso intelectual. Quando o pai de Ajit Banerjee desaparece sem deixar rastro, ele contrata um jovem detetive particular Byomkesh Bakshi para encontrá-lo. Bakshi descobre pistas de que Banerjee poderia estar a chantagear o veterano líder político Gajanan Sikdar. Depois que o cadáver de Banerjee é encontrado dentro da fábrica de Sikdar, o caso parece fechado até que Sikdar é envenenado e morre também. Em última análise, Bakshi tropeça num círculo de contrabando de heroína executado por um cérebro criminoso conhecido por vários nomes e disfarces e que pode estar jogando um jogo extremamente perigoso que vai além dos limites do mero crime e progride para a traição contra o Estado.","first_air_date":"2015-04-02","runtime":139,"episode_run_time":[139],"vote_average":6.7,"created_by":["Dibakar Banerjee Productions"],"production_companies":[{"name":"Dibakar Banerjee Productions"}],"cast":["Sushant Singh Rajput","Anand Tiwari","Neeraj Kabi","Divya Menon","Swastika Mukherjee"],"backdrop_path":"https://image.tmdb.org/t/p/original/iReAdpZgtNYYAcgAQEwMUYJuGAV.jpg","poster_path":"https://image.tmdb.org/t/p/original/7IvuZioWIvj8UAIWJhGtLsqwwt.jpg","certification":"N/A","genres":["Ação","Mistério","Drama"],"trailer":"N/A"},
