"12121":{"id":"12121","name":"Feita Por Encomenda","slug":"feita-por-encomenda","original_title":"Made in America","overview":"Sara Matthews é uma afro-americana que trabalha em uma livaria em Oakland e cria Zora Matthews, sua filha adolescente. O marido de Sara morreu há muitos anos atrás e Zora cresceu pensando que ele fosse seu pai, até que descobre por acidente que ela era produto de uma inseminação artificial. Pesquisando no computador do banco de esperma, Zora descobre quem é seu pai biológico: Hal Jackson, um vendedor de automóveis branco que aparece na televisão fazendo palhaçadas com animais. Sara também fica aturdida, pois especificou que queria um doador negro. Sara decide conversar com Hal, mas o encontro não é dos mais amistosos.","first_air_date":"1993-01-06","runtime":111,"episode_run_time":[111],"vote_average":5.5,"created_by":["Regency Enterprises","Warner Bros. Pictures"],"production_companies":[{"name":"Regency Enterprises"},{"name":"Warner Bros. Pictures"}],"cast":["Whoopi Goldberg","Ted Danson","Will Smith","Nia Long","Paul Rodríguez"],"backdrop_path":"https://image.tmdb.org/t/p/original/gFsBGyMJezO1wMRmEjBX8YEh0Mc.jpg","poster_path":"https://image.tmdb.org/t/p/original/8lr6np11F46KIBxYtOzLmdn10Q9.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
