"363103":{"id":"363103","name":"Nise: O Coração da Loucura","slug":"nise-o-coracao-da-loucura","original_title":"Nise: O Coração da Loucura","overview":"Ao voltar a trabalhar em um hospital psiquiátrico no subúrbio do Rio de Janeiro, após sair da prisão, a doutora Nise da Silveira (Gloria Pires) propõe uma nova forma de tratamento aos pacientes que sofrem da esquizofrenia, eliminando o eletrochoque e lobotomia. Seus colegas de trabalho discordam do seu meio de tratamento e a isolam, restando a ela assumir o abandonado Setor de Terapia Ocupacional, onde dá início a uma nova forma de lidar com os pacientes, através do amor e da arte.","first_air_date":"2016-04-21","runtime":106,"episode_run_time":[106],"vote_average":8.2,"created_by":["TvZERO"],"production_companies":[{"name":"TvZERO"}],"cast":["Glória Pires","Julio Adrião","Claudio Jaborandy","Fabrício Boliveira","Roberta Rodrigues"],"backdrop_path":"https://image.tmdb.org/t/p/original/jk0j3DjkCpdjWXZ8fBIdPeKr1Ui.jpg","poster_path":"https://image.tmdb.org/t/p/original/eDEu2l4xvmhVuLerpHzzz2i1lgm.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
