"38809":{"id":"38809","name":"Preto e Branco","slug":"preto-e-branco","original_title":"Black and White","overview":"Quando Charlie (Bijou Phillips) e seus amigos, brancos, começam a andar com o aspirante a cantor de rap oriundo do Harlem Rich Bower (Power) e seu grupo, o American Cream Team, negros, as facções de cada raça começam a questionar quais são suas reais motivações. Fascinados com esta mescla de culturas, um documentarista de cinema e uma jovem rica (Brooke Shields) resolvem capturar o fenômeno através das câmeras, com a ajuda de seu desengonçado marido Terry (Robert Downey Jr.). Enquanto isso, o policial Mark Clear (Ben Stiller) deseja se vingar de sua ex-namorada Greta (Claudia Schiffer), que o trocou por um astro de basquete negro e amigo de Rich Bower. Diferentes mundos - ricos e pobres, brancos e negros - se encontram apenas para descobrir que ninguém é quem realmente parece ser.","first_air_date":"1999-09-04","runtime":99,"episode_run_time":[99],"vote_average":4.7,"created_by":["Bigel / Mailer Films","Palm Pictures","Screen Gems"],"production_companies":[{"name":"Bigel / Mailer Films"},{"name":"Palm Pictures"},{"name":"Screen Gems"}],"cast":["Robert Downey Jr.","Scott Caan","Stacy Edwards","Allan Houston","Gaby Hoffmann"],"backdrop_path":"https://image.tmdb.org/t/p/original/n7ylI2IACVkXqKUEiHnTZlZBaYe.jpg","poster_path":"https://image.tmdb.org/t/p/original/dSBSU7zdK8c7x8tzeQQhuSoVuIh.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
