"401600":{"id":"401600","name":"O Bandido","slug":"o-bandido","original_title":"A Viszkis","overview":"Entre 1993 e 1999, um homem roubou 29 instituições financeiras em Budapeste. Bancos, correios e até mesmo agências de viagens foram vítimas de sua onda de crimes. A polícia não tinha pistas e nenhuma esperança de encontrá-lo durante seu período de seis anos. A única pista deixada nas cenas do crime era o aroma distinto do uísque. A mídia batizou-o de “Bandido de Whisky”. Nunca machucando fisicamente ninguém, muitos começaram a seguir avidamente suas escapadas através da mídia. Um imigrante da Transilvânia, que também era goleiro de uma das maiores equipes de hóquei da cidade, chamado Attila Ambrus, foi finalmente identificado como o “Bandido de Whisky”. A polícia finalmente o capturou ... ou assim eles pensaram.","first_air_date":"2017-11-23","runtime":126,"episode_run_time":[126],"vote_average":6.5,"created_by":["InterCom"],"production_companies":[{"name":"InterCom"}],"cast":["Bence Szalay","Piroska Móga","Zoltán Schneider","Björn Freiberg","Imre Csuja"],"backdrop_path":"https://image.tmdb.org/t/p/original/CEGtCp36ORWISlEwPGDt1GNaGh.jpg","poster_path":"https://image.tmdb.org/t/p/original/2qSUBUCNRYJ5bftepK8g0XIkgVl.jpg","certification":"N/A","genres":["Ação","Crime"],"trailer":"N/A"},
