"360994":{"id":"360994","name":"Amor ao Primeiro Filho","slug":"amor-ao-primeiro-filho","original_title":"Ange et Gabrielle","overview":"Apesar de algumas dores nas costas, depois de uma noitada, Ange Pagani um arquiteto bem sucedido e mulherengo está tendo um dia perfeitamente normal. Até que uma mulher muito agitada chamada Gabrielle aparece em seu escritório, alegando que seu filho teria engravidado a sua filha. O problema é que, Ange não tem filho! Ele faz de tudo para evitar Gabrielle, mas por algum motivo, encontra-se irresistivelmente atraído por esta mãe solteira causando estragos em sua vida. Quando o bebê nasce, Ange sente a sensação da paternidade, enquanto Gabrielle, tenta manter sua vida da mesma forma. Uma relação familiar que envolve todos, e eles descobrem algo que nunca sentiram, o Amor Incondicional.","first_air_date":"2015-11-11","runtime":90,"episode_run_time":[90],"vote_average":5.7,"created_by":["Benji Films"],"production_companies":[{"name":"Benji Films"}],"cast":["Isabelle Carré","Patrick Bruel","Laurent Stocker","Alice de Lencquesaing","Thomas Solivérès"],"backdrop_path":"https://image.tmdb.org/t/p/original/sbOkOhKVpRA9WBX8gKhZ1NtBEsh.jpg","poster_path":"https://image.tmdb.org/t/p/original/omIp98ZLm3IJnusSQxY83cEeB09.jpg","certification":"14","genres":["Romance","Comédia"],"trailer":"N/A"},
