"15170":{"id":"15170","name":"Buddy, Meu Gorila Favorito","slug":"buddy-meu-gorila-favorito","original_title":"Buddy","overview":"Diversas pessoas gostam de dizer que seus animais de estimação são humanos, mas uma socialite de Nova York, Gertrude \"Trudy\" Lintz dá um novo significado para esta afirmação. Ela e o marido, Bill Lintz, um médico, vivem em uma mansão onde ela cria um casal de chimpanzés, que os veste como humanos e além disto têm refeições na mesa com ela e Bill. Há ainda um papagaio, cachorros, patos, cavalos e gatos na propriedade, mas ela tem um especial interesse pelos símios, tanto que quando fica sabendo que na Filadélfia há um filhote de gorila bem doente, ela ruma para lá e traz para casa o filhote. Bill diagnostica que ele está com pneumonia dupla em estágio avançado e, ao tomar conhecimento que o filhote já tem um nome: Buddy, não acha conveniente, pois será mais duro para Trudy quando ela morrer. No entanto ela se mostra incansável e consegue salvar a vida de Buddy, que cresce e, se tornando mais forte, começa a ficar difícil de ser controlado.","first_air_date":"1997-06-06","runtime":84,"episode_run_time":[84],"vote_average":4.9,"created_by":["Columbia Pictures","The Jim Henson Company","Jim Henson Pictures","American Zoetrope"],"production_companies":[{"name":"Columbia Pictures"},{"name":"The Jim Henson Company"},{"name":"Jim Henson Pictures"},{"name":"American Zoetrope"}],"cast":["Rene Russo","Robbie Coltrane","Alan Cumming","Irma P. Hall","Paul Reubens"],"backdrop_path":"https://image.tmdb.org/t/p/original/2wOvyxAUiP76qqLIsayMPMhUi8g.jpg","poster_path":"https://image.tmdb.org/t/p/original/tjRu5fpKTVPPnOamDH5Xt9aupmb.jpg","certification":"L","genres":["Família","Aventura","Comédia","Drama"],"trailer":"N/A"},
