"26261":{"id":"26261","name":"Confusão em Dose Dupla","slug":"confusao-em-dose-dupla","original_title":"Cops & Robbersons","overview":"Norman Robberson (Chevy Chase) é o pai carinhoso e afável de uma família urbana típica dos anos 1990. Seu pequeno vício é a obsessão por programas policiais na TV e a sua mais recente fantasia é participar de algo como bandidos e mocinhos na vida real. Jake Stone (Jack Palance) é o detetive mais durão da corporação e não se desvia das missões um milímetro sequer. Para perseguir um criminoso, os oficiais liberados pelo temível Detetive Stone se mudam para a casa da família Robberson e ficam de tocaia no inimigo instalado na casa vizinha. Para o detetive Stone o pesadelo apenas começou, mas para Norman, um suave e tranquilo contador, o sonho hilariante tomou vida.","first_air_date":"1994-04-15","runtime":92,"episode_run_time":[92],"vote_average":5.1,"created_by":["TriStar Pictures","Channel Productions"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Channel Productions"}],"cast":["Chevy Chase","Jack Palance","Dianne Wiest","Robert Davi","David Barry Gray"],"backdrop_path":"https://image.tmdb.org/t/p/original/or1yV4hqs8X2sDsFhGXSR8Vc8YM.jpg","poster_path":"https://image.tmdb.org/t/p/original/mGWsMogX8CQhvGlhmY6wtb0jXMI.jpg","certification":"N/A","genres":["Comédia","Thriller","Crime"],"trailer":"N/A"},
